import React from 'react'
import {NavLink} from 'react-router-dom'
import classes from './Dialogs.module.css'

type DialogsTypes = {
    id: number
}

type Dialog = {
    name: string
    id: number
}

const DialogsItem: React.FC<Dialog> = (props) => {

    return (
        <li className={classes.dialogsLink}><NavLink id={props.id}/>{props.name}</li>
    )
}

const Dialogs = () => {
    return (
        <div className={classes.Dialogs}>

            <div className={classes.dialogsBlock}>
                <ul className={classes.dialogsItem}>
                    <DialogsItem name='Kostya' id='1'/>
                    <DialogsItem name='Lena' id='2'/>
                    <DialogsItem name='Daniel' id='3'/>
                    <DialogsItem name='Pasha' id='4'/>
                    <DialogsItem name='Andrey' id='5'/>

                </ul>
                <div className={classes.dialogsMessage}>
                    <div>Avatar</div>
                    <div>Text message</div>
                </div>
            </div>

        </div>
    )
}

export default Dialogs
